import './index.css';
import React from 'react';
import useSWR from 'swr';
import Cosmic from 'cosmicjs';

import Header from './views/components/header.jsx';
import Main from './views/main.jsx';
import Footer from './views/components/footer.jsx';

const api = Cosmic();
const bucket = api.bucket({
  slug: "acuteowl",
  read_key: 'WloiX24Ge3tts629dUaH6KzhSDuAgTMDtRUdxC4TgIhM340lnc'
})
const fetchPosts = async () => {
  const data = await bucket.getObjects({
    query: {
      type: 'posts'
    },
    props: 'slug,title'
  })
  return data
}

function App() {
  const { data, error } = useSWR("https://api.cosmicjs.com/v2/buckets/acuteowl/objects?pretty=true&query=%7B%22type%22%3A%22posts%22%7D&read_key=WloiX24Ge3tts629dUaH6KzhSDuAgTMDtRUdxC4TgIhM340lnc&limit=20&props=slug,title,content,", fetchPosts);
  if(!data) {
    return <div>Loading...</div>;
  }
  console.log(data);

  return (
    <div>
      <Header/>

      <Main/>
      <Footer/>
    </div>
  );
}

export default App;
